import React from "react";
import { Link } from "react-router-dom";

const App = () => {
  return (
    <div className="m-16">
      <Index />
    </div>
  );
};

const Index = () => {
  return (
    <div class="text-xl">
      <h2 class="font-bold text-blue-400 mb-4">Jon's React playground</h2>
      <p class="mb-4">
        I am learning React. This is the page where I show stuff I'm learning.
      </p>
      <ol>
        <li>
          <a href="page1">Page 1: Learning things</a>
        </li>
      </ol>
    </div>
  );
};

const Header = () => {
  return (
    <div>
      <p>Header</p>
    </div>
  );
};

const Homepage = () => {
  return (
    <div>
      <Header />
      <h1>Homepage </h1>
      <Link to="/about">Go to Aboutpage</Link>
    </div>
  );
};

const Aboutpage = () => {
  return (
    <div>
      <Header />
      <h1>Aboutpage</h1>
      <Link to="/">Go to Aboutpage</Link>
    </div>
  );
};
export { Header, Homepage, Aboutpage };
